import React from "react";
import {
    ListItem,
    ItemInfo
} from "../home_style"
class List extends React.Component{
    render(){
        return (
            <ListItem>
                <img alt="list-pic" src="https://upload-images.jianshu.io/upload_images/11013747-30ef93d2a1f7f4cc.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240"></img>
                <ItemInfo>

                </ItemInfo>
            </ListItem>
        )
    }
}
export default List;
